import React from 'react';
import '../App.css';
import api from '../api'

const load = async () =>{
    await api.getAllProducts().then(products => {
        this.setState({
            products: products.data,
        })
    })
    console.log(this.products);
}

export const Cups = () => {
    return (
        load()
    )
}
